import React, { useState } from 'react';

import Modal from '../../aux/Modal';
import ArrangementDialog from '../../Dialog/components/ArrangementDialog/ArrangementDialog';

import './styles.scss';

export default function CheckoutCartElement(props) {
    const [dialog, setDialog] = useState(false);

    return(
        <>
        <div className="checkout-cart-el">
            <div className="checkout-cart-el__content">
                <button onClick={() => setDialog(true)} 
                    className="btn view-el">
                    <p>Ver</p>
                </button>
                <img className="element-img" 
                    src={"https://ikebana-app-content.s3-sa-east-1."+
                    "amazonaws.com/static/garden.jpg"} alt="planta" />
                <h3 className="element-title">{props.name}</h3>
            </div>
        </div>
            {
            dialog &&
                <Modal>
                    <ArrangementDialog handler={() => setDialog(false)}/>
                </Modal>
            }
        </>
    );
}
